import React, { useState } from 'react';
import './App.css';

function App() {
  const [selected, setSelected] = useState("signUp");
  const signUpForm = <form>
                      <h1>Sign Up for Free</h1> 
                      <input className="fullname" placeholder="First Name*"  name="firstname" required></input> 
                      <input className="fullname" placeholder="Last Name*" name="lastname" style={{float:"right"}} required></input><br></br>
                      <input placeholder="Email Address*" name="email" required></input> <br></br>
                      <input placeholder="Set A Password*" name="password" required></input><br></br>
                      <button  onClick={() => console.log({selected})} type="submit" className="bottom" style={{marginTop: "50px"}}>GET STARTED</button>
                      </form>
  const logInForm = 
   <form>
  <h1>Welcome Back</h1> 
  <input placeholder="Email Address*" name="email" required></input> <br></br>
  <input placeholder="Set A Password*" name="password" required></input><br></br>
  <button  onClick={() => console.log({selected})} type="submit" className="bottom" style={{marginTop: "50px"}}>GET STARTED</button>
  </form>
  return (
    <div className = "box">
      <div className = "container">
        <button active='true' onClick={() => setSelected("signUp")} className="top" >Sign Up</button> 
        <button onClick={() => setSelected("logIn")} {...({selected} === "logIn" ? console.log('sss') : null)}  className="top">Log In</button> <br></br>
        {signUpForm }
      </div>
    </div>
  );
}

export default App;
